import React from "react";
import { Button } from "react-bootstrap";
import { FaPenAlt } from 'react-icons/fa'
import { MdDeleteOutline } from "react-icons/md";



const ReadOnlyRow = ({ contact, handleEditClick, handleDeleteClick }) => {
  return (
    <>
      <tr className="row">
        <td className="col-4 text-truncate">{contact.fullName}</td>
        <td className="col-4 text-truncate">{contact.address}</td>
        <td className="col-4 d-flex justify-content-end">
          <Button
            className="mr-1 btn-sm btn-secondary"
            type="button"
            onClick={(event) => handleEditClick(event, contact)}
          >
            <FaPenAlt />
          </Button>

          <Button size="md" type="button" className="btn-sm p-1" variant="outline-primary" onClick={() => handleDeleteClick(contact.id)}>
          <MdDeleteOutline />
          </Button>
        </td>
      </tr>
    </>
  );
};

export default ReadOnlyRow;
